import React, { useState, useEffect } from 'react'
import axios from 'axios'


const FirePokemon = () => {

  const [data, setData] = useState(null)

  useEffect(() => {
    const getData = async () => {
      const response = await axios.get("https://pokeapi.glitch.me/v1/pokemon/3")
      setData(response)
    }
    getData()
  }, [])
  console.log('Data>>>', data?.data[0].name)


  return (
    <>
    <div>
    {data?.data.map(p => {
      return <p>
        {p.name}
      </p>
    })
    }
    </div>
    </>
    )

}



export default FirePokemon
